const tabs = document.querySelectorAll("nav.tabs a.tab");
tabs.forEach((tab) => {
  tab.addEventListener("click", (evt) => {
    evt.target.classList.add("active");
  });
});

const isVisible = (elem) => {
  var distance = elem.getBoundingClientRect();
  return (
    distance.top >= 50 &&
    distance.left >= 0 &&
    distance.bottom <=
      (window.innerHeight || document.documentElement.clientHeight) &&
    distance.right <=
      (window.innerWidth || document.documentElement.clientWidth)
  );
};

const username = document.querySelector(
  "section.profile-container header div.profile p span:last-child"
);
const username2 = document.querySelector("div.nav-profile span");
const name = document.querySelector(
  "section.profile-container header div.profile p span:first-child"
);

const navProfile = document.querySelector("div.nav-profile");

const reposContainer = document.querySelector("section.repos");

window.onscroll = () => {
  if (
    username &&
    !isVisible(username) &&
    window.matchMedia("(min-width: 768px)").matches
  ) {
    navProfile.classList.add("active");
  }
  if (
    username &&
    isVisible(username) &&
    window.matchMedia("(min-width: 768px)").matches
  ) {
    navProfile.classList.remove("active");
  }
};

const getRepos = (searchTerm) =>
  ` {
    viewer {
      location
      login
      name
      repositories(first: 50){
          nodes{
              name
              description
              primaryLanguage{
                name
                color
              }
              updatedAt
          }
      }
    }
  }  
  `;

function dateDiff(date, interval) {
  var second = 1000,
    minute = second * 60,
    hour = minute * 60,
    day = hour * 24,
    week = day * 7;
  let date1 = new Date(date);
  let date2 = new Date();
  var timediff = date2 - date1;
  if (isNaN(timediff)) return NaN;
  switch (interval) {
    case "years":
      return date2.getFullYear() - date1.getFullYear();
    case "months":
      return (
        date2.getFullYear() * 12 +
        date2.getMonth() -
        (date1.getFullYear() * 12 + date1.getMonth())
      );
    case "weeks":
      return Math.floor(timediff / week);
    case "days":
      return Math.floor(timediff / day);
    case "hours":
      return Math.floor(timediff / hour);
    case "minutes":
      return Math.floor(timediff / minute);
    case "seconds":
      return Math.floor(timediff / second);
    default:
      return undefined;
  }
}

const getActualDate = (date) => {
  if (dateDiff(date, "minutes") <= 0) {
    return "Updated seconds ago";
  }
  if (dateDiff(date, "minutes") > 0 && dateDiff(date, "hours") <= 0) {
    return `Updated ${dateDiff(date, "minutes")} minutes ago`;
  }
  if (dateDiff(date, "hours") > 0 && dateDiff(date, "days") <= 0) {
    return `Updated ${dateDiff(date, "hours")} hours ago`;
  }
  if (dateDiff(date, "days") > 0 && dateDiff(date, "days") < 31) {
    return `Updated ${dateDiff(date, "days")} days ago`;
  }
  let stdDate = new Date(date);
  const months = {
    1: "Jan",
    2: "Feb",
    3: "Mar",
    4: "Apr",
    5: "May",
    6: "Jun",
    7: "Jul",
    8: "Aug",
    9: "Sep",
    10: "Oct",
    11: "Nov",
    12: "Dec",
  };
  const stdMonth = stdDate.getMonth();
  const stdDay = stdDate.getDate();

  return `Updated on ${months[stdMonth]} ${stdDay}`;
};

window.onload = () => {
  const options = {
    method: "post",
    headers: {
      "Content-Type": "application/json",
      Authorization: `Bearer ${process.env.BEARER_TOKEN}`,
    },
    body: JSON.stringify({
      query: getRepos(),
    }),
  };

  fetch(`https://api.github.com/graphql`, options)
    .then((res) => res.json())
    .then((data) => {
      data = data.data.viewer;
      let repos = data.repositories.nodes;
      console.log(repos);
      name.innerHTML = data.name;
      username.innerHTML = data.login;
      username2.innerHTML = data.login;
      repos = repos
        .reverse()
        .filter((elem, index) => index < 20)
        .map(
          (elem, index) => `
      <div class="repo">
          <main>
            <a href="#">${elem.name}</a>
            <p class="description">${
              elem.description ? elem.description : ""
            }</p>
            <div class="info">
              ${
                elem.primaryLanguage
                  ? `<div class="language">
              <div style='background-color: ${elem.primaryLanguage.color}'></div>
              <span>${elem.primaryLanguage.name}</span>
            </div>`
                  : ""
              }
              
              <p class="timeline">${getActualDate(elem.updatedAt)}</p>
            </div>
          </main>
          <button>
            <div>
              <svg viewBox="0 -10 511.98685 511" xmlns="http://www.w3.org/2000/svg" fill="#7C848C">
                <path
                  d="m114.59375 491.140625c-5.609375 0-11.179688-1.75-15.933594-5.1875-8.855468-6.417969-12.992187-17.449219-10.582031-28.09375l32.9375-145.089844-111.703125-97.960937c-8.210938-7.167969-11.347656-18.519532-7.976562-28.90625 3.371093-10.367188 12.542968-17.707032 23.402343-18.710938l147.796875-13.417968 58.433594-136.746094c4.308594-10.046875 14.121094-16.535156 25.023438-16.535156 10.902343 0 20.714843 6.488281 25.023437 16.511718l58.433594 136.769532 147.773437 13.417968c10.882813.980469 20.054688 8.34375 23.425782 18.710938 3.371093 10.367187.253906 21.738281-7.957032 28.90625l-111.703125 97.941406 32.9375 145.085938c2.414063 10.667968-1.726562 21.699218-10.578125 28.097656-8.832031 6.398437-20.609375 6.890625-29.910156 1.300781l-127.445312-76.160156-127.445313 76.203125c-4.308594 2.558594-9.109375 3.863281-13.953125 3.863281zm141.398438-112.875c4.84375 0 9.640624 1.300781 13.953124 3.859375l120.277344 71.9375-31.085937-136.941406c-2.21875-9.746094 1.089843-19.921875 8.621093-26.515625l105.472657-92.5-139.542969-12.671875c-10.046875-.917969-18.6875-7.234375-22.613281-16.492188l-55.082031-129.046875-55.148438 129.066407c-3.882812 9.195312-12.523438 15.511718-22.546875 16.429687l-139.5625 12.671875 105.46875 92.5c7.554687 6.613281 10.859375 16.769531 8.621094 26.539062l-31.0625 136.9375 120.277343-71.914062c4.308594-2.558594 9.109376-3.859375 13.953126-3.859375zm-84.585938-221.847656s0 .023437-.023438.042969zm169.128906-.0625.023438.042969c0-.023438 0-.023438-.023438-.042969zm0 0" />
              </svg>
              <span>Star</span>
            </div>
          </button>
        </div>
      `
        )
        .join("");
      reposContainer.innerHTML = repos;
    })
    .catch(console.log);
};
